{{notice|small=no|image=The middle finger.svg  |header=Why Retirement?|I'm tired of dealing with assholes who know nothing of creating good content, but who think that they have a right to be abusive.  I'm tired of watching certain groups get protection from racist slurs, but so long as all you're doing is denigrating an Indian, it's OK, because that not really racism.  I'm tired of admins who see that, but decide that it's not a real problem, so they don't address the problem, so the problems get worse.  I'm tired of ArbCom members who are not old enough to shave, who have no real life experience, but who decide that threats to out someone merely merit a warning (been there, done that, filed the lawsuit).  I have no desire to go through that again, so the asshats win.  I'm outta here.

To my friends and to those who took the time to listen to me today, thanks.  I appreciate your kindness.  That specifically includes the admins I chatted with on IRC - I really do appreciate your taking the time to speak to me.
